import './AddTodo.css';
import './TodoItem.css';

export const AddTodo = () => {
    return (
        <div className='container'>
            <h1>Welcome to Todo Applcation</h1>
            <form>
                <h3>Enter your task here...</h3>
                <textarea id="txtarea"></textarea>
                <button type="submit" className='btn btn-green add'>Add Task</button>
            </form>
        </div>
    )
};
